import React from 'react';
import { Link } from 'react-router-dom';
import './Welcome.css';

function Welcome() {
    return (
        <div className="welcome-container">
            <div className="welcome-content">
                <div className="logo-container">
                    <img src="/images/logo.jpeg" alt="EduConnect Logo" className="logo" />
                    <h1 className="brand-name">EduConnect</h1>
                </div>
                
                <p className="welcome-text">
                    Connecting Minds, Bridging Education
                </p>
                
                <div className="welcome-buttons">
                    <Link to="/login" className="welcome-button">Log In</Link>
                    <Link to="/signup" className="welcome-button">Sign Up</Link>
                </div>
            </div>
        </div>
    );
}

export default Welcome;
